import React from 'react';

import './Servicios.css';


const Servicios = () => {
return (
  <div className="flex flex-column w-70">
    <div className="w-50 vh-75 center " controls>
      <ul>
        <li>About</li>
        <li>Plans</li>
        <li>Contact</li>
        <li>Services</li>
      </ul>

    </div>
    <p
      className="f1 ttu center pointer orange br2 ba b--orange"
      >Home</p>
  </div>
);

}

export default Servicios;
